                    qm_pm_med_adh_metrics m
                    JOIN patient_medication_fills f ON f.patient_id = m.patient_id
                        AND f.measure_key = m.measure_key
-- order by m.patient_id, m.patient_id, m.next_fill_date
                        AND f.next_fill_date = m.next_fill_date
                GROUP BY 1, 2, 3, 4
                HAVING
                    COUNT(*) > 1 )
SELECT *
FROM
    dupes d
join patient_medication_fills f2 on d.patient_id = f2.patient_id and d.measure_key = f2.measure_key and d.next_fill_date = f2.next_fill_date
order by d.patient_id
;


DROP TABLE IF EXISTS _new_values;
CREATE TEMP TABLE _new_values AS
SELECT
    m.id                                                                      metric_id
  , m.measure_key
  , m.patient_id
  , m.next_fill_date metric_next_fill
  , f.analytics_id                                                            fill_id
--   , f.days_supply
--   , f.next_fill_date
--   , f.next_fill_date - NOW()::DATE - 6
  , NOW()::DATE - 6                                                           new_next_fill_date
  , (f.next_fill_date - (NOW()::DATE - 6))                                    days_supply_diff
  , f.days_supply - (f.next_fill_date - (NOW()::DATE - 6))                    new_days_supply
FROM
    qm_pm_med_adh_metrics m
    JOIN patient_medication_fills f ON f.patient_id = m.patient_id
        AND f.measure_key = m.measure_key
        AND f.next_fill_date = m.next_fill_date
WHERE
    f.days_supply - (f.next_fill_date - (NOW()::DATE - 6)) > 0
ORDER BY
    m.patient_id, m.patient_id, m.next_fill_date
;

SELECT * FROM _new_values ;

UPDATE qm_pm_med_adh_metrics m
SET next_fill_date = nv.new_next_fill_date
from _new_values nv
where nv.metric_id = m.id;

UPDATE patient_medication_fills f
SET next_fill_date = nv.new_next_fill_date, days_supply = nv.new_days_supply
from _new_values nv
where nv.fill_id = f.analytics_id;

