;
update qm_pm_med_adh_synth_periods sp
set end_date = nv.new_next_fill_date - 1
FROM
    _new_values nv
where nv.patient_id = sp.patient_id
and nv.measure_key =  sp.measure_key
and nv.metric_next_fill = sp.end_date + 1
and nv.metric_next_fill != nv.new_next_fill_date
;

select *
FROM
    _new_values nv
join qm_pm_med_adh_synth_periods sp
on nv.patient_id = sp.patient_id
and nv.measure_key =  sp.measure_key
and nv.metric_next_fill = sp.end_date + 1
;



